/*
 *   This function updates active task flag for each subrate.
 * The function is called at model base rate, hence the
 * generated code self-manages all its subrates.
 */
static void rate_scheduler(void)
{
  /* Compute which subrates run during the next base time step.  Subrates
   * are an integer multiple of the base rate counter.  Therefore, the subtask
   * counter is reset when it reaches its limit (zero means run).
   */
  (offset_rate210_M->Timing.TaskCounters.TID[1])++;
  if ((offset_rate210_M->Timing.TaskCounters.TID[1]) > 1) {/* Sample time: [0.004s, 0.0s] */
    offset_rate210_M->Timing.TaskCounters.TID[1] = 0;
  }

  (offset_rate210_M->Timing.TaskCounters.TID[2])++;
  if ((offset_rate210_M->Timing.TaskCounters.TID[2]) > 2) {/* Sample time: [0.006s, 0.0s] */
    offset_rate210_M->Timing.TaskCounters.TID[2] = 0;
  }

  (offset_rate210_M->Timing.TaskCounters.TID[3])++;
  if ((offset_rate210_M->Timing.TaskCounters.TID[3]) > 3) {/* Sample time: [0.008s, 0.0s] */
    offset_rate210_M->Timing.TaskCounters.TID[3] = 0;
  }

  (offset_rate210_M->Timing.TaskCounters.TID[4])++;
  if ((offset_rate210_M->Timing.TaskCounters.TID[4]) > 4) {/* Sample time: [0.01s, 0.0s] */
    offset_rate210_M->Timing.TaskCounters.TID[4] = 0;
  }
}

real_T rt_powd_snf(real_T u0, real_T u1)
{
  real_T y;
  real_T tmp;
  real_T tmp_0;
  if (rtIsNaN(u0) || rtIsNaN(u1)) {
    y = (rtNaN);
  } else {
    tmp = fabs(u0);
    tmp_0 = fabs(u1);
    if (rtIsInf(u1)) {
      if (tmp == 1.0) {
        y = (rtNaN);
      } else if (tmp > 1.0) {
        if (u1 > 0.0) {
          y = (rtInf);
        } else {
          y = 0.0;
        }
      } else if (u1 > 0.0) {
        y = 0.0;
      } else {
        y = (rtInf);
      }
    } else if (tmp_0 == 0.0) {
      y = 1.0;
    } else if (tmp_0 == 1.0) {
      if (u1 > 0.0) {
        y = u0;
      } else {
        y = 1.0 / u0;
      }
    } else if (u1 == 2.0) {
      y = u0 * u0;
    } else if ((u1 == 0.5) && (u0 >= 0.0)) {
      y = sqrt(u0);
    } else if ((u0 < 0.0) && (u1 > floor(u1))) {
      y = (rtNaN);
    } else {
      y = pow(u0, u1);
    }
  }

  return y;
}
